import React from 'react'
import "../A"

export default function AllList() {
  return (
    <div id="grid">
        {user.map((value, index) => {
          return (
            <>
              <div className="gridDiv">
                <h4>{value.name}</h4>
                <h5>{value.uid}</h5>
              </div>
            </>
          );
        })}
      </div>
  )
}
